import React from 'react';
import { useSelector } from 'react-redux';
import Gallery from '../modals/Gallery.jsx';
import Main from '../modals/Main.jsx';
import Story from '../modals/Story.jsx';

const Pages = () => {
  const modal = useSelector((state) => state.modal);
  const { show, type } = modal;

  const setModal = {
    1: <Main show={show} />,
    2: <Story show={show} />,
    3: <Gallery show={show} />,
  };

  return (
    <div>
      {setModal[type]}
    </div>
  );
};

export default Pages;
